import React, {useState, useEffect} from 'react';
import Trans from './transaction';
import './App.css';


function App() {

    const [table, setTable] = useState("")

    useEffect(() => {
      fetch("https://api.npoint.io/6c17bb8fe6201901f1b2")
      .then(r => r.json())
      .then((data) => {
          console.log(data)
          setTable(data.transaction)
      })
    }, [])

  return (
    <div>
      {table.map((trans) => (
        <Trans key={trans} />
      ))}
    </div>

  );
}

export default App;
